import { Link } from "react-router-dom";
import courses from "../data.js/courses";
import cour from '../data.js/courses'
const Courses = () => {
  return (
    <>
      <h1>Frends</h1>
      {Courses.map(frends => (
        <div key={courses.id}>
          <Link to={courses.slug} className="frendsLink">
            {Courses.title}
          </Link>
        </div>
      ))}
    </>
  );
};

export default Courses;
